INSERT INTO `contenidos` VALUES (1,'20191','100048',1,'La contabilidad gerencial.\\n‐ Qué es la contabilidad. El ciclo contable. Los Estados Financieros.\\n‐Qué es la contabilidad gerencial. Objetivos e importancia de la contabilidad gerencial.\\n‐Diferencias entre la contabilidad gerencial y la contabilidad financiera. Usuarios de la información. Tipo de información. Normas de regulación.','Reconoce el recorrido de las operaciones empresariales en el ciclo contable de una empresa. Evalúa la utilidad de la información financiera y gerencial.','Exposición dialogada\\nTaller',NULL,'2018-11-12 21:58:25','2018-11-12 21:58:25'),(2,'20191','100048',2,'La Contabilidad de Costos Empresariales.\\n‐ Concepto. Importancia y su aplicación. Relación entre la contabilidad Gerencial y la Contabilidad de Costos.','Determinación, distribución y aplicación de los costos en una empresa mercantil.','Dinámica grupal/debate en clase',NULL,'2018-11-12 21:58:25','2018-11-12 21:58:25'),(3,'20191','100048',3,'Elementos de los Estados Financieros:\\n‐ Balance General: Activo, pasivo y patrimonio.\\n‐ Estado de Resultados: Ingresos y Gastos','Analizar y aplicar el marco legal normativo para la elaboración de los Estados Financieros.','Exposición dialogada',NULL,'2018-11-12 21:58:25','2018-11-12 21:58:25'),(5,'20191','120009',1,'Origen y autonomía del Derecho Laboral.\n•	La revolución industrial y el nacimiento del Derecho Laboral.\nPrincipios del Derecho de Trabajo\n•	Principio Protector\n•	Principio de primacía de la realidad.\n•	Principio de Igualdad en las Relaciones Laborales\n•	Principio de Irrenunciabilidad de Derechos.\n•	Indubio Pro Operario','Breve análisis de la revolución industrial y la mano de obra.\nAnálisis de los principios básicos del Derecho Laboral.','Exposición dialogada/Dinámica grupal',1,'2018-11-19 22:03:16','2018-11-19 22:03:16'),(6,'20191','120009',2,'CONTRATO DE TRABAJO\n•	Elementos Esenciales del Contrato de Trabajo\n•	Partes del Contrato de Trabajo\n•	Formalidades.\n•	El Período de Prueba\n•	Consecuencias del Perfeccionamiento del Contrato de Trabajo','Conocimiento de las características  y elementos  de contrato de trabajo','Debate en clase',2,'2018-11-19 22:03:52','2018-11-19 22:03:52'),(7,'20191','120009',3,'MODALIDADES DE CONTRATACION LABORAL\n•	Contrato a Plazo Indeterminado \n•	Contrato Sujetos a Modalidad\n•	Contratos en Régimen de Tiempo Parcial','Analizar las diferentes alternativas de una relación laboral.','Discusión de caso',3,'2018-11-19 22:04:59','2018-11-19 22:04:59'),(8,'20191','120009',4,'Diferencia con otros contratos.','Diferencia entre el contrato de trabajo y el de locación de servicios; efectos del sinceramiento de una relación encubierta como relación laboral.','Debate en clase\nDiscusión de casos',4,'2018-11-19 22:05:36','2018-11-19 22:05:36'),(9,'20191','120009',5,'ESTABILIDAD LABORAL\n•	Clases\n•	Tratamiento Legislativo','Analizar cómo ha ido cambiando la estabilidad en el ámbito laboral.','Control de lectura\nDiscusión de caso',5,'2018-11-19 22:08:13','2018-11-19 22:08:13'),(10,'20191','120009',6,'SUSPENSIÓN DEL CONTRATO DE TRABAJO\n•	Clases. Perfecta e Imperfecta\n•	Tipos.','Analizar las causales que se dan, dentro de la relación laboral.','Dinámica grupal',6,'2018-11-19 22:08:49','2018-11-19 22:08:49'),(11,'20191','120009',7,'EXTINCION DEL CONTRATO DE TRABAJO\n\n•	 Causas de Extinción de vínculo laboral. El Despido\n-	Causa justa de despido:\n-	Relacionadas con la Capacidad del Trabajador\n-	Relacionadas con la Conducta del Trabajador','Conoce y describe las diferentes formas de cese individual y sus consecuencias en la empresa, entre ellas, el pago de una indemnización y la reposición al puesto de labores, así como','Dinámica grupal',7,'2018-11-19 22:09:27','2018-11-19 22:09:27'),(12,'20191','120009',8,'•	Actos de Hostilidad Equiparables al Despido\n•	Terminación de la Relación Laboral por Causas Objetivas.\n•	Procedimiento de Despido por Causa Justa.\na.	Despido Arbitrario.\nb.	Despido Nulo.','El impacto de las resoluciones emitidas por la Corte Suprema y el Tribunal Constitucional.','Control de lectura\nDiscusión de caso',8,'2018-11-19 22:10:01','2018-11-19 22:10:01'),(13,'20191','120009',9,'Jornada de Trabajo\n•	Facultades del Empleador\n•	Procedimiento para la Modificación de la Jornada de Trabajo\n•	Trabajadores excluidos de la Jornada Máxima\n•	Refrigerio\n•	Trabajo Nocturno\n\nHorario de Trabajo\n•	Horas de Lactancia\n•	Horas Extras','Analizar las diferentes modalidades que se pueden dar en una relación laboral respecto al horario de trabajo','Clase debate/ Ejercicios prácticos',9,'2018-11-23 15:20:11','2018-11-23 15:20:11'),(14,'20191','120009',10,'DESCANSOS REMUNERADOS\n•	Descanso Semanal Obligatorio. \n•	Descansos en Días Feriados.\n•	Descanso Vacacional.','Analizar cada uno de los conceptos remunerativos. Y Aplicarlos mediante casos.','Ejercicios prácticos/\nAnálisis de casos',10,'2018-11-23 15:24:32','2018-11-23 15:24:32'),(15,'20191','120009',11,'Concepto Remunerativos:\nModalidades de determinación de la prestación.\nPago de la Remuneración. \nCondiciones de Trabajo. \nRemuneración Mínima Vital.\nAsignación Familiar.\nBonificaciones.\nPrestaciones Alimentarias.','Analizar cada uno de los conceptos remunerativos. Y Aplicarlos mediante casos.','Ejercicios prácticos/ Discusión de caso',11,'2018-11-23 15:25:23','2018-11-23 15:25:23'),(16,'20191','120009',12,'12	\nConceptos No Remunerativos','Analizar cada uno de los conceptos no remunerativos.','Discusión de caso',12,'2018-11-23 15:25:56','2018-11-23 15:25:56'),(17,'20191','120009',13,'GRATIFICACIONES\n•	Ordinarias\n•	Extraordinarias\n•	Legales: Fiestas Patrias y Navidad','Principales derechos que la legislación laboral concede al trabajador determinando su forma correcta de aplicación.','Ejercicios prácticos\n/Discusión de caso',13,'2018-11-23 15:26:31','2018-11-23 15:26:31'),(18,'20191','120009',14,'COMPENSACION POR TIEMPO DE SERVICIOS\n•	Naturaleza\n•	Ámbito de Aplicación\n-	Trabajadores con derecho a su percepción\n-	Período Computable\n-	Remuneración Computable.','Principales derechos que la legislación laboral concede al trabajador determinando su forma correcta de aplicación.','Ejercicios prácticos\n/Discusión de caso',14,'2018-11-23 15:27:06','2018-11-23 15:27:06'),(19,'20191','120009',15,'CALCULO DE BENEFICIOS SOCIALES\n\nConceptos intervinientes en el Cálculo de Beneficios Sociales al cese de un trabajador (CTS, Gratificaciones legales, vacaciones Truncas, etc)','Reconocer los derechos que le corresponderían al trabajador con los respectivos cálculos que se realizan.','Ejercicios prácticos\n/Discusión de caso',15,'2018-11-23 15:27:56','2018-11-23 15:27:56'),(20,'20191','120009',16,'CALCULO DE BENEFICIOS SOCIALES\n\nConceptos intervinientes en el Cálculo de Beneficios Sociales al cese de un trabajador (CTS, Gratificaciones legales, vacaciones Truncas, etc)','Reconocer los derechos que le corresponderían al trabajador con los respectivos cálculos que se realizan.','Ejercicios prácticos\n/Discusión de caso',16,'2018-11-23 15:28:36','2018-11-23 15:28:36');
