INSERT INTO `estrategias` VALUES (1,'20191','100048','Lecturas\nLos materiales asignados previamente deberán ser leídos para el desarrollo de cada sesión de los cuales se tomarán evaluaciones permanentes en cada sesión. Es importante leer los materiales asignados, de manera que se pueda complementar el tratamiento de los mismos en clase.\nParticipación en clase\nLa participación en clase es de primera importancia en el curso, la participación incluye no solamente los aportes referidos al tema a tratar, sino las preguntas que surgieran con referencia a él.\nTrabajo grupal\nEn particular, se deberán conformar equipos de trabajo de seis integrantes (como máximo por equipo).',1,'2018-11-12 21:58:25','2018-11-12 21:58:25'),(2,'20191','120009','Lecturas\nSe tomarán controles de lecturas referidos a los temas a tratar en clase. Es importante leer los materiales asignados para cada sesión, de manera que se pueda complementar el tratamiento de los mismos en clase. \n\n\nCasos, testimonios y ejercicios\nA lo largo del curso se desarrollarán casos aplicativos.\n\n\nParticipación en clase\nLa participación en clase es de primera importancia en el curso, la participación incluye no solamente los aportes referidos al tema a tratar, sino las preguntas que surgieran con referencia a él. \n\n\nTrabajo grupal\nEn particular, se deberán conformar equipos de trabajo. Análisis a través de la casuística procesos judiciales laborales a fin de que el alumno pueda entender.',1,'2018-11-23 15:29:05','2018-11-23 15:29:05'),(3,'20191','120009','Lecturas\nSe tomarán controles de lecturas referidos a los temas a tratar en clase. Es importante leer los materiales asignados para cada sesión, de manera que se pueda complementar el tratamiento de los mismos en clase. \n\n\nCasos, testimonios y ejercicios\nA lo largo del curso se desarrollarán casos aplicativos.\n\n\nParticipación en clase\nLa participación en clase es de primera importancia en el curso, la participación incluye no solamente los aportes referidos al tema a tratar, sino las preguntas que surgieran con referencia a él. \n\n\nTrabajo grupal\nEn particular, se deberán conformar equipos de trabajo. Análisis a través de la casuística procesos judiciales laborales a fin de que el alumno pueda entender.',1,'2018-11-23 15:33:01','2018-11-23 15:33:01'),(4,'20191','120009','Lecturas\nSe tomarán controles de lecturas referidos a los temas a tratar en clase. Es importante leer los materiales asignados para cada sesión, de manera que se pueda complementar el tratamiento de los mismos en clase. \n\n\nCasos, testimonios y ejercicios\nA lo largo del curso se desarrollarán casos aplicativos.\n\n\nParticipación en clase\nLa participación en clase es de primera importancia en el curso, la participación incluye no solamente los aportes referidos al tema a tratar, sino las preguntas que surgieran con referencia a él. \n\n\nTrabajo grupal\nEn particular, se deberán conformar equipos de trabajo. Análisis a través de la casuística procesos judiciales laborales a fin de que el alumno pueda entender.',1,'2018-11-23 15:34:28','2018-11-23 15:34:28');
