INSERT INTO `sumillas` VALUES (1,'8','100048','El curso tiene como propósito integrar las teorías, las técnicas y las herramientas adquiridas en las materias de contabilidad general y administración que le permita llegar al alumno a desarrollar las habilidades de análisis, integración de la información para la construcción de propuestas y soluciones que llevan al logro de los objetivos de la organización. Se pondrá énfasis en el análisis financiero de los estados financieros y su relación con los costos empresariales.','2018-11-12 21:58:25','2018-11-12 21:58:25'),(2,'8','120009','El curso de Derecho Laboral, tiene por objeto proporcionar al alumno un conocimiento Integral de los principios jurídicos y normas legales que rigen las relaciones laborales entre trabajadores y empleadores de la actividad privada. Se estudiará la naturaleza jurídica, fuentes y autonomía del Derecho Laboral y se analizarán los principales derechos y obligaciones que surgen de la relación entre trabajador y empleador dentro del régimen laboral de la actividad privada.','2018-11-19 16:31:54','2018-11-19 16:31:54');
