INSERT INTO `unidades` VALUES (1,'20191','100048',1,'LA CONTABILIDAD GERENCIAL.','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Pellentesque ac nunc facilisis, aliquet elit vitae, dapibus ipsum. Nulla ut quam ultrices, suscipit nulla a, tristique sapien.',1,'2018-11-12 21:58:25','2018-11-12 21:58:25'),(2,'20191','100048',6,'ANALISIS E INTERPRETACION DE LOS ESTADOS FINANCIEROS.','Quisque vitae sapien pharetra, ullamcorper quam nec, pellentesque tellus. Phasellus scelerisque augue sed volutpat lobortis.',2,'2018-11-12 21:58:25','2018-11-12 21:58:25'),(3,'20191','120009',1,'EL DERECHO DEL TRABAJO','Al final de la presente unidad el alumno será capaz de:  \n-	Explicar el origen del Derecho Laboral como rama autónoma del Derecho.\n-	 Aplicar los principios regentes del Derecho Laboral a casos prácticos analizados. \n-	Reconocer la existencia de un Contrato de Trabajo a través del análisis de sus elementos esenciales, diferenciándolo de otros tipos de contratos.\n-	Establecer el tipo de contrato laboral aplicable en cada caso, analizando la realidad de los hechos que generan la relación laboral, aplicando para ello los Principios del Derecho Laboral.\n-	Identificar los tipos de Estabilidad Laboral existentes.\n-	Identificar, explicar y aplicar los tipos de suspensión de vínculo laboral existentes en la legislación laboral peruana.\n-	Identificar, explicar y aplicar los tipos de cese de vínculo laboral existentes en la legislación laboral peruana.',NULL,'2018-11-19 21:08:25','2018-11-19 21:08:25'),(4,'20191','120009',9,'UNIDAD II: EL TIEMPO LABORAL','Al final de la presente unidad el alumno será capaz de:  \n\n-	Distinguir la diferencia entre Jornada Laboral y Horario Laboral.\n-	Explicar las facultades del Empleador para el establecimiento y modificación de la Jornada y el Horario de trabajo.\n-	Identificar la Jornada Diurna.\n-	Identificar la Jornada Mixta.\n-	Identificar la Jornada Nocturna y calcular el pago procedente.\n-	Identificar la existencia de horas extras y calcular el monto que corresponde como pago por las mismas.\n-	Identificar la labor en día feriado y en descanso semanal obligatorio y calcular cómo debe aplicarse el pago por dicha labor.\n-	Identificar el cumplimiento de los requisitos para la adquisición del derecho al descanso físico vacacional así como para el goce de dicho descanso físico.\n-	Calcular el pago correspondiente por descanso físico vacacional, vacaciones truncas al cese y triple indemnizatoria.',NULL,'2018-11-19 21:29:20','2018-11-19 21:58:41'),(5,'20191','120009',11,'UNIDAD III: CONCEPTOS REMUNERATIVOS Y NO REMUNERATIVOS','Al final de la presente unidad el alumno será capaz de:  \n\n-	Identificar los conceptos remunerativos que forman parte de los ingresos del trabajador, a través de la evaluación de los elementos esenciales de la remuneración.\n-	Identificar los conceptos no remunerativos que forman parte de los ingresos del trabajador, a través de la aplicación de la normativa legal laboral a los casos prácticos.\n-	Establecer los conceptos que forman parte de la remuneración base de cálculo de los diferentes beneficios sociales.',NULL,'2018-11-19 21:59:37','2018-11-19 21:59:37'),(6,'20191','120009',13,'UNIDAD IV: BENEFICIOS SOCIALES','Al final de la presente unidad el alumno será capaz de:  \n\n-	Gratificaciones: establecer el período de cálculo correspondiente así como la base de cálculo remunerativa y en base a estos dos datos, proceder a calcular el monto a pagar por dicho concepto en cada caso práctico analizado.\n-	Compensación por Tiempo de Servicios: establecer el período de cálculo correspondiente así como la base de cálculo remunerativa y en base a estos dos datos, proceder a calcular el monto a pagar por dicho concepto en cada caso práctico analizado.\n-	Identificar y calcular los Beneficios Sociales que corresponden a un trabajador en caso de cese.',NULL,'2018-11-19 22:00:20','2018-11-19 22:00:20');
